import Link from 'next/link';

const Index = () => (
    <div>
        <h1>
            Next.js Main Page.
        </h1>

        <Link href='/about'>
          <a>Link API - About</a>
        </Link>

        <br/>

        <a href='/about'>A tag - About</a>
    </div>
);

export default Index;
